    false,nt"url": null,nt"notes": "This annual narrative report for Steigerwald
    Lake NWR outlines Refuge accomplishments during the 1991 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. The report
    includes a planning section which discusses the master plan, management planning,
    public participation, and research and investigations. Refuge administration is
    outlined; information about personnel, volunteer programs, funding, and technical
    assistance is given. Habitat management is also covered; subjects include wetlands,
    forests, pest control, and water rights. The wildlife section of the report discusses
    wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
    waterbirds, raptors, game mammals, and fisheries resources. The public uses of the
    Refuge described in this report include outdoor classrooms and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction and rehabilitation. Cooperative programs and items of interest are
    provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
